import {Routes} from "./Routes";

export const Main = () => {
    return (
        <div className="container-fluid">
            <div className="row">
                <div className="col-md-6"><Routes /></div>
                <div className="col-md-6"><Routes /></div>
            </div>
        </div>
    );
};
